window.bookSummaryJSON = "<p>Humanity will finally be saved or destroyed in the shattering conclusion to the post-apocalyptic and highly acclaimed <i>NYT</i> best-selling trilogy that won the Hugo Award three years in a row.</p> <p>The Moon will soon return. Whether this heralds the destruction of humankind or something worse will depend on two women.</p> <p>Essun has inherited the power of Alabaster Tenring. With it, she hopes to find her daughter Nassun and forge a world in which every orogene child can grow up safe. For Nassun, her mother's mastery of the Obelisk Gate comes too late. She has seen the evil of the world, and accepted what her mother will not admit: That sometimes what is corrupt cannot be cleansed, only destroyed.</p>"; 
